export function getClass(i) {
    if ((i % 20 === 0)&&( i % 5 === 0)) {
        return 'wide'
    }

    else if (i % 5 === 0) {
        return 'big';
    }
    else if (i % 6 === 0) {
        return 'wide'
    }

}
